 package mrm.physical;import java.util.Enumeration;import mrm.codeOperation.Operations;import store.Balances;import store.Receipt;public class ReceiptPrinter{        public ReceiptPrinter()    {     }          public void printReceipt(Receipt receipt)    {        Enumeration receiptLines = receipt.getLines();                       while (receiptLines.hasMoreElements())        {            Operations.getInstance().printReceiptLine(                ((String) receiptLines.nextElement()));        }    }}